  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:45.653843\",\n\t\"name\": \"chronic-wasting-disease-fy14-report-ouray-national-wildlife-refuge-sampling-efforts\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Documents the CWD concern for Ouray NWR
  and the hunt/winter season sampling totals. Chronic wasting disease (CWD) was first
  discovered in Utah in 2002. To date 60 deer and 2 elk have tested positive to CWD.
  Five Wildlife Management Units (WMU) have positive samples: 8,9,13,14, and 16. Ouray
  NWR is within WMU 9. Six of the positive mule deer and one elk were found in WMU
  9. While the Utah Department of Wildlife Resources (UDWR) has a CWD sampling plan
  in place that is sensitive enough to detect prevalence at 1% with 95% confidence
  within each WMU, the number of samples taken at Ouray NWR or adjacent fell to zero
  by 2009 as check stations were many miles away from the Refuge. Since 2009, Refuge
  staff have collected CWD samples from deer and elk harvested or found dead such
  as roadkill from the Refuge or immediately adjacent to the Refuge to monitor CWD
  in this distinct herd.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
